import logo from './logo.svg';
import './App.css';
import {MDCTextField} from '@material/textfield';

function App() {
  const textField = new MDCTextField(document.querySelector('.mdc-text-field'));

  return (
    <div className="App">
    <TextField id="outlined-basic" label="Outlined" variant="outlined" />
    </div>
  );
}

export default App;
